import { products } from '../data/products';

const Catalog = () => {
  const [filteredProducts, setFilteredProducts] = useState(products);

  // ... остальной код ...

  return (
    <div className="catalog">
      {/* ... фильтры ... */}
      <motion.div className="products-container" layout>
        <AnimatePresence>
          {filteredProducts.map(product => (
            <motion.div
              key={product.id}
              layout
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              exit={{ opacity: 0 }}
            >
              <ProductCard product={product} />
            </motion.div>
          ))}
        </AnimatePresence>
      </motion.div>
    </div>
  );
};
